import axios from '../axios_request'
import urls from './urls'
const ApiPlugin={
    install(app){
        app.config.globalProperties.$api={
            getHomeData:()=>{
                return axios.post(urls.homeData)
            }
        }
    }
}
export default ApiPlugin
